import React, { Component } from 'react';
import {
  BrowserRouter as Router,
  Route, Link
} from 'react-router-dom'

import Home from './Home';
import Signup from './Signup';

function NavHeader(props) {
  return(
    <Navbar sticky="top" bg="light" expand="md">
    <Navbar.Brand className="homeNav" href="/">CoopNet</Navbar.Brand>
    <Navbar.Toggle aria-controls="basic-navbar-nav" />
    <Navbar.Collapse className="headerCollapse" id="basic-navbar-nav">
      <Nav className="mr-auto">
        <Button variant="light">Projects</Button>
        <Button variant="light">For Investors</Button>
        <Button variant="light"><NavDropdown title="About Us" id="basic-nav-dropdown">
          <NavDropdown.Item href="#action/3.4">About Us</NavDropdown.Item>
          <NavDropdown.Divider />
          <NavDropdown.Item href="#action/3.1">Our Mission</NavDropdown.Item>
          <NavDropdown.Item href="#action/3.2">Our Process</NavDropdown.Item>
          <NavDropdown.Item href="#action/3.3">Our Team</NavDropdown.Item>
          <NavDropdown.Divider />
          <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
        </NavDropdown></Button>
        <Button variant="light"><Link to="/signup">Sign Up</Link></Button>
      </Nav>
    </Navbar.Collapse>
  </Navbar>

  );
}

export default class App extends Component {
  render() {
    return (
<Router>
      <div>
        <Route path="/" exact component={Home} />
        <Route path="/signup" component={Signup} />
      </div>
    </Router>
    );
  }
}
